import React, { useEffect, useState } from "react";
import axios from "axios";

function LatestMatch() {
  const [index, setIndex] = useState(0);
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const fetch = async () => {
    const fetchResult = await axios.get(
      "https://api.github.com/users/upes-open/repos"
    );
    const fetchData = fetchResult.data;
    console.log(fetchData);
    // console.log(fetchData[0].name);
    // fetchData = Object.keys(fetchData);

    setData(fetchData);
    setTimeout(() => {
      setLoading(false);
    }, 500);
  };

  useEffect(() => {
    fetch();
    const intervalId = setInterval(
      () => setIndex((index) => index + 1),
      3000 // every 3 seconds
    );
    return () => clearTimeout(intervalId);
  }, []);

  return (
	 <section className="latest-match-area latest-match-bg pt-115 pb-90">
        <div className="container">
          <div className="row justify-content-center">
            <div className="col-xl-6 col-lg-8">
              <div className="section-title title-style-three white-title text-center mb-70">
                <h2>Our <span>Projects</span></h2>
                <p>Compete with 100 players on a remote island for winner takes showdown
                  known issue where certain skin strategic</p>
              </div>
            </div>
          </div>
          <div className="row">
          {data.map((result) => (
            <div className="col-lg-6">
              <div className="latest-match-box mb-30">
                <div className="tournament-schedule-content">
                  <h3><a href="/#">Forza <span>{result.name}</span></a></h3>
                  <p>Find tecology people for digital projects in public There are many variations.</p>
                  <div className="tournament-schedule-meta">
                    <h5>price : <span>$125,00</span></h5>
                    <a href="/#">Joining</a>
                  </div>
                </div>
              </div>
            </div>
          ))}
            <div className="col-lg-6">
              <div className="latest-match-box mb-30">
                {/* <div className="latest-match-thumb">
                  <img src="assets/img/images/latest_match_thumb02.jpg" alt="" />
                </div> */}
                <div className="tournament-schedule-content">
                  <h3><a href="/#">shooting <span>land</span></a></h3>
                  <p>Find tecology people for digital projects in public There are many variations.</p>
                  <div className="tournament-schedule-meta">
                    <h5>price : <span>$125,00</span></h5>
                    <a href="/#">Joining</a>
                  </div>
                </div>
              </div>
            </div>
            <div className="col-lg-6">
              <div className="latest-match-box mb-30">
                {/* <div className="latest-match-thumb">
                  <img src="assets/img/images/latest_match_thumb03.jpg" alt="" />
                </div> */}
                <div className="tournament-schedule-content">
                  <h3><a href="/#">Thanos <span>Sky ii</span></a></h3>
                  <p>Find tecology people for digital projects in public There are many variations.</p>
                  <div className="tournament-schedule-meta">
                    <h5>price : <span>$125,00</span></h5>
                    <a href="/#">Joining</a>
                  </div>
                </div>
              </div>
            </div>
            <div className="col-lg-6">
              <div className="latest-match-box mb-30">
                {/* <div className="latest-match-thumb">
                  <img src="assets/img/images/latest_match_thumb04.jpg" alt="" />
                </div> */}
                <div className="tournament-schedule-content">
                  <h3><a href="/#">Call Of <span>Duty ii</span></a></h3>
                  <p>Find tecology people for digital projects in public There are many variations.</p>
                  <div className="tournament-schedule-meta">
                    <h5>price : <span>$125,00</span></h5>
                    <a href="/#">Joining</a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
  )
}

export default LatestMatch
